var viewer = new Cesium.Viewer("cesiumContainer", {
  terrainProvider: Cesium.createWorldTerrain(),
});

//scene is standard to make sure browser supports picks
var scene = viewer.scene;
if (!scene.pickPositionSupported) {
  window.alert("This browser does not support pickPosition.");
}

//i usually dont set this.. if false - all objects drawn above ground. if true, objects drawn half "submerged" into ground if its center has a height of 0.
scene.globe.depthTestAgainstTerrain = true;

//create different possible actions... may use this to add toolbar such that u can select a few diff functions for the right click/
var viewModel = {
  rightClickAction: "annotate",
  middleClickAction: "red",
};

Cesium.knockout.track(viewModel);

var annotations = scene.primitives.add(new Cesium.LabelCollection());

var handler = new Cesium.ScreenSpaceEventHandler(viewer.canvas);









//what to do when user right clicks
handler.setInputAction(function (movement) {
  var feature = scene.pick(movement.position);
  if (!Cesium.defined(feature)) {
    return;
  }

  var action = viewModel.rightClickAction;
    annotate(movement, feature);
}, Cesium.ScreenSpaceEventType.RIGHT_CLICK);





//function to change color of a selected entity

function makeProperty(entity) {
	entity.path.width = 50;
	entity.path.material.color._value = Cesium.Color.RED;
}
//makeProperty(czml[1])
//TEST czml[1].path.width = 50
//TEST czml[1].path.material.polylineGlow.color = {rgbaf : [1,0,0]}
//test are done finding the variable u wanna edit using chrome's console


//what to do when middle click
handler.setInputAction(function (movement) {
  var picked = viewer.scene.pick(movement.position);
  if (!Cesium.defined(picked)) {
    return;
  }
  var pickedd = picked.id; //very important as czml entities are created as a primitive (i.e. one whole default set so that it loads faster)
  //console.log(pickedd);
  //console.log(pickedd.path.material.color._value);
  makeProperty(pickedd)
}, Cesium.ScreenSpaceEventType.MIDDLE_CLICK);




  
  
  
  
  
  
  
  
  
//ref from https://sandcastle.cesium.com/?src=3D%20Tiles%20Interactivity.html
//annotate the height of object!! very cool. u have to click exactly on the polyline. else display wrong height.
function annotate(movement, feature) {
  if (scene.pickPositionSupported) {
    var cartesian = scene.pickPosition(movement.position);
    if (Cesium.defined(cartesian)) {
      var cartographic = Cesium.Cartographic.fromCartesian(cartesian);
      var height = cartographic.height.toFixed(2) + " m";

      annotations.add({
        position: cartesian,
        text: height,
        showBackground: true,
        font: "14px monospace",
        horizontalOrigin: Cesium.HorizontalOrigin.LEFT,
        verticalOrigin: Cesium.VerticalOrigin.BOTTOM,
        disableDepthTestDistance: Number.POSITIVE_INFINITY,
      });
    }
  }
}
